p1 = p +ggtitle("model PDF") + labs(x="FS", y="ReadPosRankSum") + geom_tile(aes(fill = lod)) + scale_fill_gradient(high="green", low="red", space="rgb")
p <- qplot(x,y,data=df.FS.ReadPosRankSum, color=retained, alpha=I(1/7),legend=FALSE) +theme(panel.background = element_rect(fill = "white"), panel.grid.minor = element_line(colour = "white"), panel.grid.major = element_line(colour = "white"))
q <- geom_point(aes(x=x,y=y,color=retained),data=dummyData, alpha=1.0, na.rm=TRUE)
p2 = p + q + labs(x="FS", y="ReadPosRankSum") + scale_colour_gradient(name="outcome", high="black", low="red",breaks=c(-1,1),guide="legend",labels=c("filtered","retained"))
p <- qplot(x,y,data=df.FS.ReadPosRankSum[df.FS.ReadPosRankSum$training != 0,], color=training, alpha=I(1/7)) +theme(panel.background = element_rect(fill = "white"), panel.grid.minor = element_line(colour = "white"), panel.grid.major = element_line(colour = "white"))
q <- geom_point(aes(x=x,y=y,color=training),data=dummyData, alpha=1.0, na.rm=TRUE)
p3 = p + q + labs(x="FS", y="ReadPosRankSum") + scale_colour_gradient(high="green", low="purple",breaks=c(-1,1),guide="legend", labels=c("neg", "pos"))
p <- qplot(x,y,data=df.FS.ReadPosRankSum, color=novelty, alpha=I(1/7)) +theme(panel.background = element_rect(fill = "white"), panel.grid.minor = element_line(colour = "white"), panel.grid.major = element_line(colour = "white"))
